import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./accounts/components/Login";
import Signup from "./accounts/components/Signup";
import DoctorDashboard from "./dashboard/components/DoctorDashboard";
import UserDashboard from "./dashboard/components/UserDashboard";
import Profile from "./dashboard/components/Profile";

function App() {
  return (
    <Router>
      <Routes>
        {/* Auth Routes */}
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />

        {/* Doctor Dashboard Routes */}
        <Route path="/dashboard/doctor/*" element={<DoctorDashboard />} />
        <Route path="/dashboard/doctor/profile" element={<Profile />} />

        {/* User Dashboard Routes */}
        <Route path="/dashboard/user/*" element={<UserDashboard />} />
      </Routes>
    </Router>
  );
}

export default App;
